import logo from './logo.svg';
import React from "react";
import './App.css';

function App() {
  return (
    <div className="App">

      <form>
        <input type="text" />

        <input type="file" />
      </form>
    </div>
  );
}

export default App;
<header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
